import React from 'react';
import { Link } from 'react-router-dom';

import {
    Avatar,
    Button, 
    Paper,
    Grid,
    Box,
    Typography,
    TextField,

} from '@mui/material';

const Home = () => (
    <Grid>
        <>
            <h1 class='display-4 mt-3'>Welcome to Dextera!</h1>
            <p class='lead'>The Law firm!</p>
            <hr class='my-4' />

            <Link class='btn btn-primary btn-lg' to='/login' role='button'>Login</Link>
        </>
    </Grid>
);

export default Home;
